import React from 'react';
import './Navbar.css';

const Navbar = () => {
    return (
      <nav>
        <div className="logo">
        <div className="profile">
          <img alt="Profile" />
        </div>
        </div>
        <div className="links">
          <a href="#">Playground</a>
          <a href="#">Logs</a>
        </div>
      </nav>
    );
  };

export default Navbar;
